class PlotResidualsACF extends AbstractPlotter {
    constructor(moment, model, element) {
        super(model, element)
        this.__moment = moment;
        this.title = "ACF of residuals)"
    }

    get options() {
        let name = null;
        let residuals = null;
        if (this.__moment == "before") {
            name = "Residuals before the intervention";
            residuals = this.__model.logLikelihoodInfo.linear_reg_before_max.residuals.estimates;
        } else {
            name = "Residuals after the intervention";
            residuals = this.__model.logLikelihoodInfo.linear_reg_after_max.residuals.estimates;
        }
        let bins = 10;
        let acf = Stats.autocorrelationFunction(residuals, 0, 50).tolist();
        let data = []
        for (let i = 0; i < acf.length; i++) {
            data.push([
                i,
                Math.round(acf[i] * 100) / 100,
            ])
        }

        let y_acf_ci = 1.96 * Math.sqrt(1 / residuals.shape[0]);
        let y_max = Math.max(y_acf_ci, np.max(acf)) + 0.2;
        let y_min = Math.min(-y_acf_ci, np.min(acf)) - 0.2;
        
        return {
            chart: {
                animations: {enabled: false,},
                type: 'line',
                stacked: false,
                height: "400px",
            },
            dataLabels: {
                enabled: false,
            },
            markers: {
                size: 0,
                style: 'hollow',
            },
            stroke: {
                width: [2, 0.1,],
                curve: ['straight', 'smooth', ],
            },
            plotOptions: {
                bar: {
                    horizontal: false,
                    endingShape: 'rounded',
                    columnWidth: '5%',
                    dataLabels: {
                        position: 'top',
                    },
                },
            },
            series: [{
                name: 'ACF of residuals',
                type: 'bar',
                data: data,
            }, {
                name: '',
                type: 'area',
                data: data,
            }],
            colors: ['#E14A84', '#E14A84'],
            fill: {
                opacity: [1, 0.15,],
                //type: "gradient",
                gradient: {
                    inverseColors: false,
                    shade: 'light',
                    type: "vertical",
                    opacityFrom: 0.85,
                    opacityTo: 0.55,
                    stops: [100, 100, 0, 100,]
                }
            },
            markers: {
                size: 0
            },
            xaxis: {
                type: 'numeric',
                min: -1,
                max: np.max(acf.length),
                tickAmount: acf.length + 1,
            },
            yaxis: {
                min: y_min,
                max: y_max,
            },
            tooltip: {
                shared: true,
                intersect: false,
            },
            legend: {
                labels: {
                    useSeriesColors: !true
                },
                markers: {
                    width: [12, 0],
                }
            },
            annotations: {
                yaxis: [
                    {
                        y: y_acf_ci,
                        borderColor: '#999',
                        xAxisIndex: 0,
                        label: {
                            show: true,
                            text: 'Confidence interval band: ' + Math.round(y_acf_ci * 100) / 100,
                            style: {
                                color: "#fff",
                                background: '#775DD0'
                            }
                        }
                    }, {
                        y: -y_acf_ci,
                        borderColor: '#999',
                        xAxisIndex: 0,
                        label: {
                            show: true,
                            text: 'Confidence interval band: ' + Math.round(-y_acf_ci * 100) / 100,
                            style: {
                                color: "#fff",
                                background: '#775DD0'
                            }
                        }
                    }
                ]
            },
            title: {
                text: this.title,
                align: 'left',
                style: {
                    fontSize: '16pt',
                    fontFamily: 'Arial',
                    color: '#000000',
                    fontWeight: "bold",
                },
            },
        };
    }
}

